import React from "react";
import TopSection from "../Top/TopSection";
import Pillars from "../Mid/Pillars";
import Timeline from "../Mid/Timeline";
import Footer from "./Components/Bottom/Footer";

function Page1() {
  return (
    <div>
      <TopSection />
      <Pillars />
      <Timeline year="2017" />
      <Timeline year="2018" />
      <Footer />
    </div>
  );
}

export default Page1;
